import React, { useState, useEffect } from 'react';
import axios from 'axios';
import moment from 'moment';

const DoctorVisits = ({ userData }) => {
  const [doctorVisits, setDoctorVisits] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDoctorVisits = async () => {
      try {
        if (userData && userData.typ !== "pacjent") {
          const response = await axios.get(`http://localhost:5000/api/doctor-visits/${userData.typ}`);
          setDoctorVisits(response.data);
        }
        setLoading(false);
      } catch (error) {
        console.error('Error fetching doctor visits:', error);
        setLoading(false);
      }
    };

    fetchDoctorVisits();
  }, [userData]);

  const handleEditClick = (visitId) => {
    // Tu dodaj logikę obsługi kliknięcia przycisku edycji
    console.log("Edit visit:", visitId);
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h2>Wizyty lekarskie</h2>
      <table>
        <thead>
          <tr>
            <th>Data</th>
            <th>Godzina</th>
            <th>Pacjent</th>
            <th>Edycja</th> {/* Dodajemy kolumnę z przyciskami edycji */}
          </tr>
        </thead>
        <tbody>
          {doctorVisits.map((visit, index) => (
            <tr key={index}>
              <td>{moment(visit.date).format('YYYY-MM-DD')}</td>
              <td>{visit.time}</td>
              <td>{visit.email}</td>
              <td>
                <button onClick={() => handleEditClick(visit.id)}>Edytuj</button> {/* Przycisk edycji */}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DoctorVisits;
